import * as o from "react";
import n from "../lib/SSRBase.es.js";
import r from "../defs/Pentagon.es.js";
const e = o.forwardRef((t, a) => /* @__PURE__ */ o.createElement(n, { ref: a, ...t, weights: r }));
e.displayName = "PentagonIcon";
const c = e;
export {
  c as Pentagon,
  e as PentagonIcon
};
